import React, {useEffect} from 'react';
import { Box, Grid, Typography, Paper } from '@mui/material';
import styled from 'styled-components';
import { useGlobalConfigs } from "../store";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));


const Instagram = ()=>{
  const [state] = useGlobalConfigs();
  console.log('state', state);

  return <Box>
    <Typography variant='h4'>Placeholder</Typography>
    <Grid container spacing={2}>
      {
        (state && state.ins) && state.ins.map((element, index)=>{
          console.log(element.images)
          return (<Grid item xs={4} key={index}>
            <Box style={{ overflow: 'hidden' }}>
              <img src={element.images} alt={`images_${index}`} style={{ objectFit: 'cover' }}/>
            </Box>
            {/* <Box sx={{ backgroundImage: `${element.images}`}}></Box> */}
            </Grid>)
        })
      }
    </Grid>
  </Box>
}

export default Instagram
